export type Image = {
  id: number;
  src: string;
  col: number;
  title: string;
};

export function createImageList(imagePath: string[]) {
  let itemID: number = 0;
  let imageList: Image[] = [];

  imagePath.forEach(function (photo: string) {
    var item: Image = {
      id: itemID,
      src: photo,
      col: (itemID % 3) + 1,
      title: "",
    };
    // item["id"] = itemID;
    // item["src"] = photo;
    // item["col"] = (itemID % 3) + 1;
    // item["title"] = "";

    imageList.push(item);
    itemID++;
  });

  console.log(JSON.stringify(imageList));
}
